import React, { useState } from 'react';
import { useParams, useLocation } from 'react-router-dom';

const HalisahaDetails = () => {
  const { halisahaName } = useParams();
  const location = useLocation();
  const halisaha = location.state;

  const [reservations, setReservations] = useState([]);
  const [reservation, setReservation] = useState({
    day: '',
    time: '',
  });

  const weekDays = [
    { name: 'Pazartesi', value: 1 },
    { name: 'Salı', value: 2 },
    { name: 'Çarşamba', value: 3 },
    { name: 'Perşembe', value: 4 },
    { name: 'Cuma', value: 5 },
    { name: 'Cumartesi', value: 6 },
    { name: 'Pazar', value: 0 },
  ];

  const availableTimes = [
    '08:00', '09:00', '10:00', '11:00', '12:00',
    '13:00', '14:00', '15:00', '16:00', '17:00',
    '18:00', '19:00', '20:00', '21:00', '22:00',
  ];

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setReservation((prev) => ({ ...prev, [name]: value }));
  };

  const handleReservation = () => {
    if (reservation.day && reservation.time) {
      const selectedDay = weekDays.find((day) => day.value.toString() === reservation.day)?.name;
      const isDuplicate = reservations.some(
        (res) => res.day === selectedDay && res.time === reservation.time
      );

      if (isDuplicate) {
        alert('Bu gün ve saat için zaten bir rezervasyon yapılmış.');
        return;
      }

      const newReservation = {
        halisahaName,
        day: selectedDay,
        time: reservation.time,
      };

      setReservations((prev) => [...prev, newReservation]);
      alert(`Rezervasyonunuz alındı: ${newReservation.day} - ${newReservation.time}`);
    } else {
      alert('Lütfen bir gün ve saat seçiniz.');
    }
  };

  if (!halisaha) {
    return (
      <div className="bg-gray-100 min-h-screen flex items-center justify-center">
        <div className="bg-white p-8 rounded-lg shadow-lg max-w-md text-center">
          <h1 className="text-2xl font-bold text-red-600">Halı Saha Detayları</h1>
          <p>Halı saha bilgisi bulunamadı. Lütfen tekrar deneyiniz.</p>
        </div>
      </div>
    );
  }

  return (
    <div className="bg-gray-100 min-h-screen flex items-center justify-center">
      <div className="bg-white p-8 rounded-lg shadow-lg max-w-lg">
        <h1 className="text-3xl font-bold text-blue-600 mb-4">{halisahaName}</h1>
        <p className="text-gray-700 mb-2"><strong>Konum:</strong> {halisaha.location}</p>
        <p className="text-gray-700 mb-2"><strong>Telefon:</strong> {halisaha.phone}</p>
        <p className="text-gray-700 mb-6"><strong>Fiyat:</strong> {halisaha.price}</p>

        <h2 className="text-xl font-semibold text-gray-800 mb-4">Rezervasyon Yap</h2>
        <form className="space-y-4">
          <div>
            <label className="block text-gray-600 mb-1">Gün:</label>
            <select
              name="day"
              value={reservation.day}
              onChange={handleInputChange}
              className="w-full border-gray-300 rounded-lg p-2"
            >
              <option value="">Gün seçin</option>
              {weekDays.map((day) => (
                <option key={day.value} value={day.value}>
                  {day.name}
                </option>
              ))}
            </select>
          </div>
          <div>
            <label className="block text-gray-600 mb-1">Saat:</label>
            <select
              name="time"
              value={reservation.time}
              onChange={handleInputChange}
              className="w-full border-gray-300 rounded-lg p-2"
            >
              <option value="">Saat seçin</option>
              {availableTimes.map((time) => (
                <option key={time} value={time}>
                  {time}
                </option>
              ))}
            </select>
          </div>
          <button
            type="button"
            onClick={handleReservation}
            className="w-full bg-blue-600 text-white rounded-lg py-2 font-bold hover:bg-blue-700 transition"
          >
            Rezervasyon Yap
          </button>
        </form>

        <h2 className="text-xl font-semibold text-gray-800 mt-6">Rezervasyonlar</h2>
        <ul className="space-y-2">
          {reservations.map((res, index) => (
            <li key={index} className="bg-gray-100 p-2 rounded-lg shadow">
              <span className="font-bold">{res.day}</span> - {res.time}
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default HalisahaDetails;
